window.bookSummaryJSON = "<p>\"...If those cute little mushrooms die, Daddy's gonna take you to the mound so high...\"</p> <p>In the highly anticipated second installment of Luxe's Lullaby Trilogy, Luxe and her companions find themselves facing even greater challenges as they delve deeper into the dangerous world of the fae.</p> <p>The four race against time to find a solution that will allow Luxe to wield her powers without succumbing to their crippling side effects, while also gathering allies willing to stand against the tyrannical fae queen. As they uncover some of the queen’s well kept secrets, their bonds are tested like never before. They must summon all their courage and cunning to survive the treacherous path ahead.</p> <p>Amidst the chaos, Søren battles his own inner demons–remnants of his traumatic experience of torture at the queen’s hands. Meanwhile, Calix is faced with a harrowing betrayal and a devastating loss. Throughout it all, Alistair remains a steadfast pillar of strength for Luxe and the group, despite being forced to face the uncomfortable realities of his past.</p> <p>In this captivating sequel, the stakes are higher, the dangers are deadlier, and the fate of the fae realm hangs in the balance. Can Luxe and the guys find the path to victory despite the difficulties they face at every turn?</p> <p>Duet narration by Paige Reisenfeld and PJ Freebourn.</p>"; 
